AvgAgeInStage_1.query:
q = load "${App.Datasets.InsOpportunities_tp.FullyQualifiedName}";
q = filter q by !('StageName' in ["Closed Lost", "Closed Won"]);
q = filter q by 'DaysSinceLastActivity' >= 0;
s = load "${App.Datasets.InsPipelineTrending_tp.FullyQualifiedName}";
s = foreach s generate 'OpportunityId', 'ValidFromDate_sec_epoch', 'Time_In_Current_Stage_Duration_Seconds', date_diff("second", toDate(ValidFromDate_sec_epoch), now()) as 'lowerfilter', date_diff("second", now(), toDate(ValidToDate_sec_epoch)) as 'upperFilter';
s = filter s by 'upperFilter' > 0 && 'lowerfilter' > 0;
res = group q by 'OpportunityID', s by 'OpportunityId';
res = foreach res generate floor((sum(s.'Time_In_Current_Stage_Duration_Seconds')/(60*60*24))) as 'Age in Stage';
res = group res by all;
res = foreach res generate avg('Age in Stage') as 'avg_AgeinStage';
res = limit res 2000;

